(1, ' ', 'About Us', '<h4 style=\"text-align: justify;\"></h4>\r\n<p style=\"text-align: justify;\">                                  .                                  .</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify;\"></h4>\r\n<p style=\"text-align: justify;\">                                 .                                 .</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify;\"> </h4>\r\n<p style=\"text-align: justify;\">                                   .                                   .</p>', '<h4 style=\"text-align: justify; \">Our Vision</h4>\r\n<p style=\"text-align: justify;\">Our vision is to become the leading Company in the region. Using innovative ideas, we provide best of breed solutions . Combining creative problem solving, solid service delivery model.Our vision is to become the leading Company in the region. Using innovative ideas, we provide best of breed solutions . Combining creative problem solving, solid service delivery model.</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify; \">Our Mission</h4>\r\n<p style=\"text-align: justify;\">Our mission is to enable our clients to develop their business through innovative ideas, advice and quality of service. And to build a great place to work for, that develops and retains great people.Our mission is to enable our clients to develop their business through innovative ideas, advice and quality of service. And to build a great place to work for, that develops and retains great people.</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify;\">Work Team</h4>\r\n<p style=\"text-align: justify;\">Our team is diversified and we interact with each other with mutual respect regardless of gender, nationality and background. We trust each other and believe in fairness and transparency.Our vision is to become the leading Company in the region. Using innovative ideas, we provide best of breed solutions . Combining creative problem solving, solid service delivery model.</p>', '2017-03-06', NULL, NULL, '14888121759700.jpg', NULL, '', NULL, NULL, 1, 55, 1, 0, 1, ' ', 'About Smartend', '       ', 'Page description for good SEO', '        ', 'About, who us, kewords, smartend', NULL, NULL, 1, 1, '2017-03-06 11:06:24', '2019-02-26 00:12:34'),
